import React, { useState, useEffect } from "react";
import axios from "axios";
import { ResultTable } from "./components/Table"



function App() {
  const [employee, setEmployee] = useState({
    list: []
  })

  useEffect(() => {
    axios.get("https://randomuser.me/api/?results=20").then(res => {
      console.log(res)
      setEmployee({ list: res.data.results })
    })
  }, [])


  const filter = () => {
    setEmployee({ list: employee.list.sort((a, b) => a.data.name.first.localeCompare(b.data.name.first)) })
  }

  return (
    <div>
      <ResultTable results={employee.list} />
    </div>
  );
}

export default App;
